import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { sounds } from "./data1.js";
import { SoundBoard } from "./soundBoard.js";

function App() {
  const play = (id) => {
    const audio = document.getElementById(id);
    console.log(audio);
    audio.play();
  };

  return <SoundBoard sounds={sounds} play={play} />;
}

export default App;
